/*Hide CTRL */
.ctrlHide{
display: none;
}


/*Adjust table in html of SP Shistory */
.nx-control-richtext-label.cssHistory table th {
  background-color: #FFD700 !important; /* bright yellow */
  color: #000 !important;
  font-weight: bold !important;
  padding: 8px !important;
  border: 1px solid #000 !important;
}

/*Disable Group Control */
.nx-group-control-container.cssGrpLOCK {
  opacity: 0.9;
  pointer-events: none;
  filter: grayscale(100%);
}

/*buttons inside the action-panel*/
ntx-action-panel button {
    background-color: #FFD700 !important;
    color: #000000 !important;
    font-weight: bold !important;
    border: none !important;
    border-radius: 6px !important;
}

/* Hide delete and add buttons only if inside a container with "cssRS10cols" class */
.cssRS10cols .ntx-repeating-section-remove-button,
.cssRS10cols .btn-repeating-section-new-row {
  display: none !important;
}

.cssRS10cols + .btn-repeating-section-new-row {
  display: none !important;
}

/* === Choice radio option as Buutons Base container === */
.cssChoicebtn .nx-radio-group {
  display: inline-flex;
  border-radius: 6px;
  overflow: hidden;
  border: 1px solid #c9a800;
}

/* === Hide default radio visuals === */
.cssChoicebtn .nx-radio-faux {
  display: none;
}

/* === Each radio option === */
.cssChoicebtn .nx-radio {
  margin: 0;
}

/* === Label styling === */
.cssChoicebtn .nx-radio label {
  cursor: pointer;
}

/* === Button appearance === */
.cssChoicebtn .nx-radio-container {
  padding: 5px 9px;
  background-color: #f3c600;        /* unselected yellow */
  color: #000;
  font-weight: 600;
  border-right: 1px solid #c9a800;
  transition: background-color 0.2s ease, color 0.2s ease;
  /* Center text */
  display: flex;
  justify-content: center; /* horizontal centering */
  align-items: center;     /* vertical centering */
  text-align: center;      /* fallback for inline text */
}

/* Remove divider from last button */
.cssChoicebtn .nx-radio:last-child .nx-radio-container {
  border-right: none;
}

/* === Selected state === */
.cssChoicebtn input[type="radio"]:checked + .nx-radio-container {
  background-color: #d6aa00;        /* darker selected yellow */
  color: #000;
}

/* === Hover effect === */
.cssChoicebtn .nx-radio-container:hover {
  background-color: #e2b800;
}

/* === Text alignment === */
.cssChoicebtn .nx-radio-label {
  white-space: nowrap;
}
/* Remove Nintex radio circle */
.cssChoicebtn .nx-radio-faux {
  display: none !important;
  }
/* ===============================
   REPEATING SECTION = TABLE LOOK
   Class: cssRS10cols
================================ */

/* Repeating section container */
.cssRS10cols {
    width: 100%;
    font-family: Arial, sans-serif;
    font-size: 13px;
}

/* Header row (if you use labels as first row) */
.cssRS10cols .nx-repeating-section-header {
    display: grid;
    grid-template-columns:
        110px     /* Row label */
        130px     /* Total @ customer */
        60px      /* Cust % */
        110px     /* Cust $ */
        130px     /* Total goodwill */
        60px      /* WAPL % */
        110px     /* WAPL $ */
        140px     /* Caterpillar */
        140px     /* Recovery */
        260px;    /* Notes */
    background: #f4f4f4;
    font-weight: 600;
    border: 1px solid #cfcfcf;
}

/* Each repeating row */
.cssRS10cols .nx-repeating-section-row {
    display: grid;
    grid-template-columns:
        110px
        130px
        60px
        110px
        130px
        60px
        110px
        140px
        140px
        260px;
    border-left: 1px solid #cfcfcf;
    border-right: 1px solid #cfcfcf;
}

/* Cell styling */
.cssRS10cols .nx-repeating-section-row > div,
.cssRS10cols .nx-repeating-section-header > div {
    padding: 6px 8px;
    border-bottom: 1px solid #cfcfcf;
    display: flex;
    align-items: center;
}

/* Right align numeric inputs */
.cssRS10cols input[type="text"],
.cssRS10cols input[type="number"] {
    text-align: right;
    width: 100%;
}

/* Labels column */
.cssRS10cols .rs-col-label {
    font-weight: 600;
    white-space: nowrap;
}

/* Notes column */
.cssRS10cols .rs-col-notes {
    font-size: 13px;
    line-height: 1.4;
    align-items: flex-start;
}

/* Totals row */
.cssRS10cols .rs-total-row {
    font-weight: 600;
    background: #f9f9f9;
    border-bottom: 1px solid #cfcfcf;
}

/* Remove Nintex default spacing */
.cssRS10cols .nx-control-container {
    margin: 0;
    padding: 0;
}
